/*Table structure for table `TJ_LOGIN_STATISTICS` */

DROP TABLE IF EXISTS `TJ_LOGIN_STATISTICS`;

CREATE TABLE `TJ_LOGIN_STATISTICS` (
  `id` bigint(20) NOT NULL DEFAULT '0' COMMENT 'id',
  `schoolId` bigint(20) DEFAULT NULL COMMENT '学校Id',
  `schoolName` varchar(50) DEFAULT NULL COMMENT '学校名称',
  `gradeId` bigint(20) DEFAULT NULL COMMENT '班级Id',
