/*Table structure for table `TJ_TASK_STATISTICS` */

DROP TABLE IF EXISTS `TJ_TASK_STATISTICS`;

CREATE TABLE `TJ_TASK_STATISTICS` (
  `id` bigint(20) NOT NULL COMMENT '本表id',
  `taskId` bigint(20) DEFAULT NULL COMMENT '任务Id(视频，作业，学案)',
  `taskName` varchar(100) DEFAULT NULL COMMENT '任务名称',
  `taskType` tinyint(2) DEFAULT NULL COMMENT '任务类型(1=视频，2=作业，3=学案)',
  `schoolId` bigint(20) DEFAULT NULL COMMENT '学校id',
  `schoolName` varchar(50) DEFAULT NULL COMMENT '学校名',
  `gradeId` bigint(20) DEFAULT NULL COMMENT '班级Id',
  `subjectId` bigint(20) DEFAULT NULL COMMENT '学科Id',
  `teacherId` bigint(20) DEFAULT NULL COMMENT '教师id',
  `teacherName` varchar(50) DEFAULT NULL COMMENT 'j教师名',
  `taskStudentQty` int(11) DEFAULT '0' COMMENT '任务学生数量',
  `finishStudentQty` int(11) DEFAULT '0' COMMENT '完成学生数量',
  `finishRate` double(6,2) DEFAULT '0.00' COMMENT '完成率',
  `firstStudentId` bigint(20) DEFAULT NULL COMMENT '首次完成学生id',
  `firstStudentName` varchar(50) DEFAULT NULL COMMENT '首次完成学生姓名',
  `firstStudentKlass` varchar(50) DEFAULT NULL COMMENT '首次完成学生班级',
  `videoDibbleQty` int(11) DEFAULT '0' COMMENT '视频点播数',
  `videoCommentQty` int(11) DEFAULT '0' COMMENT '视频评论数',
  `preUrl` varchar(200) DEFAULT NULL COMMENT '预览地址',
  `crDate` date DEFAULT NULL COMMENT '当前日期',
  `groupId` bigint(20) DEFAULT NULL COMMENT '班群id(帖子字段)',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='学习任务统计';

